// PLATFORMER SCRIPT v5.8.0 ATTACK-FIRST - Checks attack state before ANY input processing
class MovimentacaoPlataformaScript {
  constructor(entidade) {
    this.entidade = entidade;
    this.velocidade = 200;
    this.velocidadeCorrida = 360;
    this.forcaPulo = 600;
    this.distanciaParede = 5;
    this.velocidadeWallSlide = 150;
    this.offsetWallEsq = 0;
    this.offsetWallDir = 0;
    this.paredeEsq = false;
    this.paredeDir = false;
    this.entidade.temGravidade = true;
    if (!this.entidade.gravidade) this.entidade.gravidade = 1200;
  }
  detectarParedes() {
    this.paredeEsq = false; this.paredeDir = false;
    if (!this.entidade.engine) return;
    const tilemapEntities = this.entidade.engine.entidades.filter(e => e.obterComponente("TilemapComponent"));
    if (tilemapEntities.length === 0) return;

    const colComp = this.entidade.obterComponente("CollisionComponent");
    if (!colComp) return;
    const bounds = colComp.obterLimitesAbsolutos(this.entidade);
    const checkDist = this.distanciaParede; const marginY = 4;
    // STRICT: Head (Top + 4px) must be BELOW the wall top. 
    // This forces the player to fall almost entirely past the corner before sliding.
    const sensorTop = bounds.y + marginY;
    const sensorBottom = bounds.y + bounds.h - marginY;
    const sensorLeft = bounds.x - checkDist;
    const sensorRight = bounds.x + bounds.w + checkDist;

    // Clearing moved to top

    for (const tmEntity of tilemapEntities) {
      const tileComp = tmEntity.obterComponente("TilemapComponent");
      const tileSize = tileComp.tileSize * tileComp.scale;
      const tilemapX = tmEntity.x || 0;
      const tilemapY = tmEntity.y || 0;

      const startCol = Math.floor(((bounds.x - checkDist) - tilemapX) / tileSize);
      const endCol = Math.floor(((bounds.x + bounds.w + checkDist) - tilemapX) / tileSize);
      const startRow = Math.floor((sensorTop - tilemapY) / tileSize);
      const endRow = Math.floor((sensorBottom - tilemapY) / tileSize);

      for (let r = startRow; r <= endRow; r++) {
        for (let c = startCol; c <= endCol; c++) {
          const tile = tileComp.getTile(c, r);
          if (!tile) continue;

          if (!tile.solid && !tile.wall && !tile.ground) continue;

          const tileX = tilemapX + c * tileSize;
          const tileY = tilemapY + r * tileSize;
          // Strict Check: HEAD (SensorTop) must be BELOW the top of the wall tile to avoid corner grabs
          const overlapsY = (sensorTop > tileY && sensorTop < tileY + tileSize && sensorBottom > tileY);
          if (!overlapsY) continue;

          if (tileX + tileSize > sensorLeft && tileX < bounds.x) { 
              this.paredeEsq = true; 
              // console.log("LDetect:", "Top:", sensorTop, "> TileY:", tileY, "=", (sensorTop > tileY));
          }
          if (tileX < sensorRight && tileX + tileSize > bounds.x + bounds.w) { 
              this.paredeDir = true; 
              // console.log("RDetect:", "Top:", sensorTop, "> TileY:", tileY, "=", (sensorTop > tileY));
          }
        }
      }
    }
  }

  // Helper: Find other scripts by class name
  obterScriptPorNome(nomeDaClasse) {
    for (const [key, comp] of this.entidade.componentes) {
      if (key.startsWith("ScriptComponent") && comp.scriptName === nomeDaClasse) {
        return comp.instance; // The running script instance
      }
    }
    return null;
  }

  processarInput(input, deltaTime) {
    // CRITICAL: Check attack state FIRST, before any other logic
    // This prevents custom code (crouch, etc) from overriding attack animations
    const attackScript = this.obterScriptPorNome("CombateMeleeScript");
    const isAttacking = attackScript && attackScript.estaOcupado && attackScript.estaOcupado();
    if (isAttacking) {
        this.entidade.velocidadeX = 0;
        return; // Let attack/slide script handle everything
    }

    const noChao = this.entidade.noChao;
    this.detectarParedes();
    let vx = 0;
    const correndo = input.teclaPressionada("Shift");
    const pressEsq = input.teclaPressionada("a") || input.teclaPressionada("A") || input.teclaPressionada("ArrowLeft");
    const pressDir = input.teclaPressionada("d") || input.teclaPressionada("D") || input.teclaPressionada("ArrowRight");
    const pressDown = input.teclaPressionada("s") || input.teclaPressionada("S") || input.teclaPressionada("ArrowDown");

    // Calculate velocity based on state
    let velAtual = this.velocidade;
    if (pressDown && noChao) {
        velAtual = this.velocidadeAgachado; // Reduced speed when crouching
    } else if (correndo) {
        velAtual = this.velocidadeCorrida;
    }

    // Safety check to prevent NaN
    if (isNaN(velAtual)) velAtual = this.velocidade;

    if (pressEsq) vx = -velAtual;
    if (pressDir) vx = velAtual;

    // Safety check for velocity
    if (isNaN(vx)) vx = 0;
    this.entidade.velocidadeX = vx;

    // ANIMACAO & ESTADO

    const spriteComp = this.entidade.obterComponente("SpriteComponent");
    const anims = spriteComp ? spriteComp.animacoes : {};
    const hasAnim = (name) => anims && (anims[name] || anims[name.toLowerCase()] || anims[name.toUpperCase()]);

    // Helper: Tenta tocar animacao preferida, senao fallback
    const playAnim = (p1, p2) => {
        if (!spriteComp) return;
        if (hasAnim(p1)) spriteComp.play(p1);
        else if (p2 && hasAnim(p2)) spriteComp.play(p2);
    };

    // WALL SLIDE LOGIC
    if (!noChao && this.entidade.velocidadeY > 0 && ((this.paredeEsq && pressEsq) || (this.paredeDir && pressDir))) {
       if (this.entidade.velocidadeY > this.velocidadeWallSlide) this.entidade.velocidadeY = this.velocidadeWallSlide;

       // Physical Snap: Force player against wall to prevent floating
       if (this.paredeEsq) this.entidade.velocidadeX = -10;
       if (this.paredeDir) this.entidade.velocidadeX = 10;

       // DEBUG: Ajuda a descobrir o nome da animacao
       // console.log("Anims Disponiveis:", Object.keys(anims));

       // Tenta varias keys comuns
       if (hasAnim("wallslide")) spriteComp.play("wallslide");
       else if (hasAnim("wall_slide")) spriteComp.play("wall_slide");
       else if (hasAnim("slide")) spriteComp.play("slide");
       else if (hasAnim("escalando")) spriteComp.play("escalando");
       else console.log("AVISO: Nenhuma animacao de wallslide encontrada (wallslide, wall_slide, slide, escalando). Disponiveis:", Object.keys(anims));

       if (spriteComp) {
           // Wall Cling Logic (Front-to-Wall): 
           // Left Wall -> Face Left (True)
           // Right Wall -> Face Right (False)
           // Offset: Both apply POSITIVE shift relative to facing direction logic (handled by engine) 
           if (this.paredeDir) { spriteComp.inverterX = false; spriteComp.offsetX = this.offsetWallDir; }
           if (this.paredeEsq) { spriteComp.inverterX = true; spriteComp.offsetX = this.offsetWallEsq; }

           // console.log("Offset Applied. L:", this.offsetWallEsq, "R:", this.offsetWallDir);
       }

       if (input.teclaPrecionadaAgora(" ") || input.teclaPrecionadaAgora("ArrowUp")) {
         this.entidade.velocidadeY = -this.forcaPulo;
         this.entidade.velocidadeX = this.paredeEsq ? velAtual : -velAtual;
         return;
       }
    } else {
       if (!noChao) {
          const isJump = this.entidade.velocidadeY < 0;
          if (isJump) playAnim("pulo", "jump");
          else playAnim("caindo", "fall");
       } else {
          // Ground Logic
          if (pressDown) {
             // Crouch or Crouch Walk
             if (Math.abs(vx) > 10) {
                 // Try crouch walk, fallback to regular walk
                 if (hasAnim("crouch_walk") || hasAnim("andar_abaixado")) {
                     playAnim("crouch_walk", "andar_abaixado");
                 } else {
                     playAnim("andando", "walk");
                 }
             } else {
                 playAnim("abaixar", "crouch");
             }
          } else if (Math.abs(vx) > 10) {
            if (correndo) playAnim("correndo", "run");
            else playAnim("andando", "walk");
          } else {
            playAnim("parado", "idle");
          }
       }

       if (vx < 0 && spriteComp) spriteComp.inverterX = true;
       if (vx > 0 && spriteComp) spriteComp.inverterX = false;
       if (spriteComp) spriteComp.offsetX = 0; // Reset offset

       if ((input.teclaPrecionadaAgora(" ") || input.teclaPrecionadaAgora("ArrowUp")) && noChao) {
          this.entidade.velocidadeY = -this.forcaPulo;
       }
    }
  }
  atualizar(dt) {
    // Safety: Validate position before physics
    if (isNaN(this.entidade.x) || isNaN(this.entidade.y)) {
        console.error("[MovPlat] Position became NaN! Resetting to spawn.");
        this.entidade.x = this.entidade.startX || 0;
        this.entidade.y = this.entidade.startY || 0;
        this.entidade.velocidadeX = 0;
        this.entidade.velocidadeY = 0;
    }

    this.entidade.velocidadeY += this.entidade.gravidade * dt;
    this.entidade.y += this.entidade.velocidadeY * dt;
    this.entidade.x += this.entidade.velocidadeX * dt;
    this.entidade.noChao = false;
  }
}

/**
 * Script de Combate Melee com Slide Attack
 * Controla ataque normal e slide attack com cooldown e hitbox.
 * Slide Attack: Pressione DOWN (S/ArrowDown) + Attack
 */

class CombateMeleeScript {
    constructor(entidade) {
        this.entidade = entidade;

        // Estado Interno
        this.atacando = false;
        this.slideAtacando = false;
        this.tempoDecorrido = 0;

        // --- ATAQUE NORMAL ---
        this.teclaAtaque = 'Control';
        this.animAttack = 'attack';
        this.duracaoAtaque = 0.8;
        this.cooldownAtaque = 0.5;

        // --- SLIDE ATTACK ---
        this.animSlide = 'slide';      // Nome da animao de slide
        this.slideVelocity = 400;       // Velocidade do slide (px/s)
        this.slideDuration = 1.5;       // Durao do slide (s)

        // === TIMING DO ATAQUE ===
        this.inicioHitbox = 0.1;
        this.duracaoHitbox = 0.2;

        // === HITBOX ===
        this.hitboxX = 30;
        this.hitboxY = 0;
        this.hitboxW = 40;
        this.hitboxH = 40;

        // === DEBUG ===
        // @type boolean
        this.mostrarDebugHitbox = true;

        // Controle
        this.inimigosAtingidos = new Set();
        this.foiPressionado = false;
        this.tempoCooldown = 0;
        this.slideDirection = 1;
    }

    iniciar() {
        const valor = String(this.mostrarDebugHitbox).toLowerCase().trim();
        this.mostrarDebugHitbox = (valor === 'true' || valor === '1' || valor === 'yes' || valor === 'sim');
        console.log(' [Debug Hitbox]:', this.mostrarDebugHitbox ? 'ATIVADO' : 'DESATIVADO');
    }

    processarInput(input) {
        const tecla = this.teclaAtaque || 'Control';
        const pressionadoAgora = input.teclaPressionada(tecla) ||
            input.teclaPressionada('z') ||
            input.teclaPressionada('Z') ||
            input.teclaPressionada('Control');

        const downPressed = input.teclaPressionada('s') ||
            input.teclaPressionada('S') ||
            input.teclaPressionada('ArrowDown');

        if (pressionadoAgora) {
            if (!this.foiPressionado) {
                if (downPressed) {
                    this.tentarSlideAttack();
                } else {
                    this.tentarAtacar();
                }
                this.foiPressionado = true;
            }
        } else {
            this.foiPressionado = false;
        }
    }

    tentarAtacar() {
        if (this.atacando || this.slideAtacando || this.tempoCooldown > 0) return;
        this.iniciarAtaque();
    }

    tentarSlideAttack() {
        if (this.atacando || this.slideAtacando || this.tempoCooldown > 0) return;
        this.iniciarSlideAttack();
    }

    iniciarAtaque() {
        this.atacando = true;
        this.tempoDecorrido = 0;
        this.tempoCooldown = this.cooldownAtaque;
        this.inimigosAtingidos.clear();
        console.log(' Ataque Iniciado!');
        const sprite = this.entidade.obterComponente('SpriteComponent');
        if (sprite) {
            console.log('    Tocando animao:', this.animAttack);
            sprite.play(this.animAttack);
        }
    }

    iniciarSlideAttack() {
        this.slideAtacando = true;
        this.tempoDecorrido = 0;
        this.tempoCooldown = this.cooldownAtaque;
        this.inimigosAtingidos.clear();
        const sprite = this.entidade.obterComponente('SpriteComponent');
        this.slideDirection = (sprite && sprite.inverterX) ? -1 : 1;
        console.log(' Slide Attack! Dir:', this.slideDirection > 0 ? 'DIREITA' : 'ESQUERDA');
        if (sprite) sprite.play(this.animSlide);
    }

    estaOcupado() {
        return this.atacando || this.slideAtacando;
    }

    atualizar(deltaTime) {
        if (typeof this.mostrarDebugHitbox === 'string') {
            const valor = this.mostrarDebugHitbox.toLowerCase().trim();
            this.mostrarDebugHitbox = (valor === 'true' || valor === '1' || valor === 'yes' || valor === 'sim');
        }

        if (this.tempoCooldown > 0) {
            this.tempoCooldown -= deltaTime;
        }

        if (this.slideAtacando) {
            this.atualizarSlideAttack(deltaTime);
            return;
        }

        if (this.atacando) {
            this.atualizarAtaqueNormal(deltaTime);
            return;
        }
    }

    atualizarAtaqueNormal(deltaTime) {
        this.tempoDecorrido += deltaTime;

        if (this.tempoDecorrido >= this.duracaoAtaque) {
            this.atacando = false;
            console.log(' Ataque Completo!');
            return;
        }

        const sprite = this.entidade.obterComponente('SpriteComponent');
        if (sprite && sprite.animacaoCompleta && sprite.animacaoCompleta()) {
            this.atacando = false;
            console.log(' Ataque Completo!');
            return;
        }

        const hitboxAtiva = (this.tempoDecorrido >= this.inicioHitbox) &&
            (this.tempoDecorrido <= (this.inicioHitbox + this.duracaoHitbox));

        if (hitboxAtiva) {
            this.verificarColisao();
        }
    }

    atualizarSlideAttack(deltaTime) {
        this.tempoDecorrido += deltaTime;
        this.entidade.velocidadeX = this.slideDirection * this.slideVelocity;

        if (this.tempoDecorrido >= this.slideDuration) {
            this.slideAtacando = false;
            this.entidade.velocidadeX = 0;
            console.log(' Slide Completo!');
            return;
        }

        this.verificarColisao();
    }

    verificarColisao() {
        const sprite = this.entidade.obterComponente('SpriteComponent');
        const invertido = sprite ? sprite.inverterX : false;

        // Calcula posio da Hitbox baseada nos valores editveis
        const offX = invertido ? (-this.hitboxX - this.hitboxW) : this.hitboxX;

        // Coordenadas Absolutas
        // X: Centro da entidade + Offset ajustado (para virar com o personagem)
        // Y: Centro da entidade + Offset Y manual - Metade da altura da hitbox (para centralizar no ponto Y)
        const areaAtaque = {
            x: this.entidade.x + (this.entidade.largura / 2) + offX,
            y: this.entidade.y + (this.entidade.altura / 2) + this.hitboxY - (this.hitboxH / 2),
            w: this.hitboxW,
            h: this.hitboxH
        };

        // Ajuste: Se invertido, o "Centro + OffX" j joga pra esquerda.
        // Se usar a borda como referncia  mais intuitivo? 
        // Vamos manter referncia ao CENTRO da entidade para ser simtrico.

        const engine = this.entidade.engine;
        if (engine) {
            engine.entidades.forEach(outra => {
                if (outra === this.entidade) return;

                // Identifica Inimigos
                const ehInimigo = outra.nome.toLowerCase().includes('inimigo') ||
                    outra.nome.toLowerCase().includes('enemy') ||
                    outra.tipo === 'inimigo';

                if (ehInimigo && !this.inimigosAtingidos.has(outra.id)) {
                    if (this.colisaoAABB(areaAtaque, outra)) {
                        this.aplicarDano(outra);
                    }
                }
            });
        }
    }

    colisaoAABB(ret1, ent2) {
        // Pega colisor do inimigo ou corpo
        let r2x = ent2.x;
        let r2y = ent2.y;
        let r2w = ent2.largura;
        let r2h = ent2.altura;

        const col2 = ent2.obterComponente('CollisionComponent');
        if (col2) {
            r2x += col2.offsetX;
            r2y += col2.offsetY;
            r2w = col2.largura;
            r2h = col2.altura;
        }

        return (
            ret1.x < r2x + r2w &&
            ret1.x + ret1.w > r2x &&
            ret1.y < r2y + r2h &&
            ret1.y + ret1.h > r2y
        );
    }

    aplicarDano(alvo) {
        console.log(`[Combate] ACERTOU: ${alvo.nome}`);
        this.inimigosAtingidos.add(alvo.id);

        // Recuo Visual
        const dir = (alvo.x > this.entidade.x) ? 1 : -1;
        alvo.x += dir * 15;

        // Dano / Morte
        if (alvo.morrer) {
            alvo.morrer();
        } else {
            alvo.destruir();
        }
    }

    renderizar(ctx) {
        const hitboxAtiva = this.slideAtacando ||
            ((this.tempoDecorrido >= this.inicioHitbox) &&
             (this.tempoDecorrido <= (this.inicioHitbox + this.duracaoHitbox)));

        if ((this.atacando || this.slideAtacando) && hitboxAtiva && this.mostrarDebugHitbox) {
            const sprite = this.entidade.obterComponente('SpriteComponent');
            const invertido = sprite ? sprite.inverterX : false;
            const offX = invertido ? (-this.hitboxX - this.hitboxW) : this.hitboxX;
            const drawX = this.entidade.x + (this.entidade.largura / 2) + offX;
            const drawY = this.entidade.y + (this.entidade.altura / 2) + this.hitboxY - (this.hitboxH / 2);

            ctx.fillStyle = this.slideAtacando ? 'rgba(0,255,255,0.3)' : 'rgba(255,0,0,0.3)';
            ctx.fillRect(drawX, drawY, this.hitboxW, this.hitboxH);

            ctx.strokeStyle = this.slideAtacando ? 'cyan' : 'red';
            ctx.lineWidth = 2;
            ctx.strokeRect(drawX, drawY, this.hitboxW, this.hitboxH);
        }
    }
}

/**
 * Controlador de Inventrio v1.0
 * Gerencia a visibilidade da janela de inventrio
 */
class InventoryController {
    constructor(entidade) {
        this.entidade = entidade;

        // --- CONFIGURAO ---
        this.teclaToggle = 'i'; // Tecla para abrir/fechar
        this.comecarAberto = false;

        // Estado Interno
        this.aberto = this.comecarAberto;

        // Inicializao
        this.inicializarEstado();
    }

    inicializarEstado() {
        // Encontra o componente de UI nesta entidade
        const ui = this.entidade.obterComponente('UIComponent');

        if (ui) {
            ui.ativo = this.aberto;
        } else {
            console.warn('[InventoryController] Componente UI no encontrado nesta entidade!');
        }

        // Se tiver sprite (fundo), tambm esconde
        if (this.entidade.temComponente && this.entidade.temComponente('SpriteComponent')) {
            this.entidade.visivel = this.aberto;
        }
    }

    atualizar() {
        if (!this.entidade.engine) return;

        // Verifica tecla pressionada (apenas no frame que desceu)
        if (this.entidade.engine.teclaPrecionadaAgora(this.teclaToggle)) {
            this.toggle();
        }
    }

    toggle() {
        this.aberto = !this.aberto;

        // Atualiza UI
        const ui = this.entidade.obterComponente('UIComponent');
        if (ui) ui.ativo = this.aberto;

        // Atualiza Sprite (Fundo)
        if (this.entidade.temComponente && this.entidade.temComponente('SpriteComponent')) {
            this.entidade.visivel = this.aberto;
        }

        console.log('[Inventory] Estado:', this.aberto ? 'ABERTO' : 'FECHADO');
    }
}
